import React, { Component } from 'react';
import logo from './logo.svg';
import './App.css';

import Dropdown from './Dropdown'

class App extends Component {

  constructor(props){
    super(props)
    this.state = {
      list : ['T10Y2Y: plot line area chart (shaded line chart)', 'GDPCA: plot bar chart for the last 20 years', 'DGS10 minus T10YIE: plot line chart']
    }
  }
  render() {
    return (
      <div className="App">
        <Dropdown list={this.state.list} />
      </div>
    );
  }
}

export default App;
